import fakeRestProvider from 'ra-data-fakerest';
import { set } from 'date-fns';
var today = set(new Date(), { minutes: 0, seconds: 0, milliseconds: 0 });
var dataProvider = fakeRestProvider({
    events: [
        {
            id: 8,
            name: 'Sign contracts',
            begin: set(today, { hours: 10 }).toISOString(),
            finish: set(today, { hours: 11, minutes: 30 }).toISOString(),
        },
        {
            id: 9,
            name: 'Open forum',
            begin: set(today, { hours: 0 }).toISOString(),
            allDay: true,
        },
    ],
}, true);
export default dataProvider;
